import React from "react";
import {Link} from "react-router-dom";

function Home(){
    return (
        <div>
            <h1>홈</h1>
            <p>가장 먼저 보여지는 페이지입니다.</p>
            <Link to="/about">소개</Link>
        </div>
    )
};

export default Home;
